import "./index.css";
import JobDetails from "../JobDetails";

function Job(props) {
  return (
    <div id="mainContainer">
      {props.jobs.map((item) => {
        return (
          <Link to>
            <div id="card">
              <h3>{item.title}</h3>
              <h6>{item.salary}</h6>
              <p>{item.company}</p>
            </div>
          </Link>
        );
      })}
    </div>
  );
}

export default Job;
